/*
   Author: Emmanuel Munoz
   Date: November 2020

   Displays the static header of the SQueerL website. Includes the logo and links to the other parts of the website.
*/
import React, { useState } from 'react';

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { Link } from 'react-router-dom';

const Header = (props) => {

   const isActive = (link) => {
      return props.highlight === link ? "active" : "";
   };

   return (
      <Navbar className="header pb-0 pt-0 border-grey border-bottom bg-dark" 
              variant="dark" 
              expand="lg"
      >
         <Navbar.Brand className="pb-0 mb-0 mt-0 pt-0">
            <Link to="/" className="">

               SQueerL
            </Link>
         </Navbar.Brand>

         <Nav className="ml-auto pb-0 mb-0">
            <Link to="/" className={`nav-link mr-3 ${isActive("home")}`}>Home</Link>
            <Link to="/contact-us/" className={`nav-link mr-3 ${isActive("contact")}`}>
               My Profile
            </Link>
         </Nav>
      </Navbar>
   );
};

export default Header;
